import { Link } from "react-router-dom";

function NavBar() {
  return (
    <nav className="p-4 bg-gray-100 flex justify-between items-center">
      <div className="flex space-x-4">
        <Link className="hover:text-blue-600 font-semibold" to="/">Browse Classes</Link>
      </div>
      <div className="flex space-x-4">
        {/* Admin links (login page handles access) */}
        <Link className="hover:text-blue-600 font-semibold" to="/admin">Admin Dashboard</Link>
        <Link className="hover:text-blue-600 font-semibold" to="/admin/classes">Manage Classes</Link>
      </div>
    </nav>
  );
}

export default NavBar;
